import React from 'react';
import Carousel from 'react-elastic-carousel';
import './ItemCarousel.css'; // Import your CSS file

function ItemCarousel() {
  const items = [
    // ... your items array ...
  ];

  return (
    <div className="carousel-container">
      <Carousel
        enableAutoPlay={true}
        autoPlaySpeed={100}
        pagination={true}
        isRTL={false}
        enableSwipe={true}
        enableTilt={true}
        itemsToScroll={1}
        isInfinite={true}
      >
        {items.map(item => (
          <div className="carousel-item" key={item.id}>
            <a href="https://www.google.com">
              <h2>{item.content}</h2>
            </a>
          </div>
        ))}
      </Carousel>
    </div>
  );
}

export default ItemCarousel;
